import React from 'react';
import './App.css';
function App() {
  return (
    <div sx={{ width: 300 }}>
      <Slider
        aria-label="Temperature" defaultValue={30} valueLabelDisplay="auto" step={10} min={10} max={110}
      />
      <Slider defaultValue={30} step={10} marks min={10} max={110} />
    </div>
  );
}
export default App;
